<?php\n   require 'vendor/autoload.php';\n\n   use Facebook\WebDriver\Remote\RemoteWebDriver;\n   use Facebook\WebDriver\Remote\DesiredCapabilities;\n   use Facebook\WebDriver\WebDriverBy;\n\n   // Start Chrome with Selenium\n   $host = 'http://localhost:4444/wd/hub'; // Adjust the URL if necessary\n   $capabilities = DesiredCapabilities::chrome();\n   $driver = RemoteWebDriver::create($host, $capabilities);\n\n   // Navigate to the page\n   $driver->get('http://example.com/paged_list.aspx');\n\n   // Execute JavaScript to show the first page\n   $driver->executeScript('show_page(1);');\n\n   // Wait for the data to load (adjust the selector as needed)\n   $driver->wait()->until(\n       WebDriverExpectedCondition::presenceOfElementLocated(WebDriverBy::cssSelector('#data-table'))\n   );\n\n   // Extract the data\n   $dataTable = $driver->findElement(WebDriverBy::id('data-table'));\n   $rows = $dataTable->findElements(WebDriverBy::cssSelector('tr'));\n\n   foreach ($rows as $row) {\n       $columns = $row->findElements(WebDriverBy::cssSelector('td'));\n       $data = [];\n       foreach ($columns as $column) {\n           $data[] = $column->getText();\n       }\n       print_r($data);\n   }\n\n   // Close the browser\n   $driver->quit();